from erpnext.setup.install import check_setup_wizard_not_completed
import frappe
from frappe.utils import cint


def after_migrate():
    persisting_data()


def insert_data(data_list):
    for data in data_list:
        if not frappe.db.exists(data.get("doctype", ""), data.get("name"), ""):
            doc = frappe.get_doc(data)
            # doc.flags.ignore_validate = True
            doc.insert(ignore_permissions=True)


def persisting_data():
    if cint(frappe.db.get_single_value("System Settings", "setup_complete") or 0):
        print("Please run the setup wizard and then migrate the site to sync the data")
        return
    insert_data(ROLE)
    insert_data(CATEGORY_TYPE)
    insert_data(CUSTOMER_TYPE)
    insert_data(DESIGNATION)
    insert_data(DOCUMENT_REGISTER_TYPE)
    insert_data(NOTIFICATION_TEMPLATE)
    insert_data(ROLE_PROFILE)
    insert_data(TRANSLATION)
    insert_data(WEB_PAGE)
    insert_data(WORKFLOW_ACTION_MASTER)
    insert_data(WORKFLOW_STATE)
    insert_data(PROPERTY_SETTER)
    insert_data(WORKFLOW)
    insert_data(WEB_PAGE)
    insert_data(MODULE_PROFILE)
    insert_data(CUSTOM_DOCPERM)
    create_compliance_service_item_group()

def create_compliance_service_item_group():
    """method adds an item group for use in one compliance"""
    if not frappe.db.exists("Item Group", "Compliance Services"):
        compliance_service_item_group_doc = frappe.new_doc("Item Group")
        compliance_service_item_group_doc.item_group_name = "Compliance Services"
        compliance_service_item_group_doc.insert()

